import perplexityLogo from "../Images/perplexityLogo.png"
import React, { useState } from 'react';


const Right = () => {
    const [open, setOpen] = useState(false);
    const [selected, setSelected] = useState("Select a model");

    const options = [
      { value: "perplexity", label: "Perplexity", icon: perplexityLogo },
      { value: "gpt-4", label: "GPT-4" },
      { value: "gemini-pro", label: "Gemini Pro" },
      { value: "claude-3", label: "Claude 3" },
    ];
    return (
      <div style={{width:"319px", margin:"24px"}}>
        <div>
            <div>
            <div>
                <label htmlFor="model-select" style={{ fontSize: "16px", color: "#333" }}>
                    <div style={{fontSize:"20px"}}>
                        Ai module
                    </div>
                </label>
                <div style={{ position: "relative", width: "200px" }}>
      <div
        onClick={() => setOpen(!open)}
        style={{
          padding: "8px 12px",
          borderRadius: "8px",
          backgroundColor: "#FAFAFA",
          cursor: "pointer",
          border: "1px solid #E0E0E0",
        }}
      >
        {selected}
      </div>

      {open && (
        <div
          style={{
            position: "absolute",
            top: "110%",
            left: 0,
            right: 0,
            backgroundColor: "#FFF",
            borderRadius: "8px",
            boxShadow: "0 2px 6px rgba(0,0,0,0.15)",
            zIndex: 10,
          }}
        >
          {options.map((option) => (
            <div
              key={option.value}
              onClick={() => {
                setSelected(option.label);
                setOpen(false);
              }}
              style={{
                padding: "10px",
                display: "flex",
                alignItems: "center",
                cursor: "pointer",
                borderBottom: "1px solid #f0f0f0",
              }}
            >
              {option.icon && (
                <img
                  src={option.icon}
                  alt={option.label}
                  style={{ width: 20, marginRight: 8 }}
                />
              )}
              {option.label}
            </div>
          ))}
        </div>
      )}
    </div>
            </div>

            </div>

        </div>

        <div style={{fontSize:"20px", marginTop:"45px"}}>
            Collections
        </div>
        <div style={{fontSize:"20px", marginTop:"45px"}}>
            Saved
        </div>
      </div>
    );
  };

  export default Right;
